import React from 'react';
import { createRoot } from 'react-dom';


createRoot(document.getElementById('root')).render(<App />);

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';



function App() {
    return (
        <Router>
            <Routes>
                <Route path="/Login"  />
            </Routes>
        </Router>
    );
}



export default App;
